        // Function to populate the table
        function populateTable(statusData) {
            var tableBody = document.getElementById('addressTableBody');
            var serialNumber = 1;
            statusData.forEach((status, index) => {
                var addresses = status.dataString.split('\n');
                addresses.forEach((address, i) => {
                    var row = tableBody.insertRow();
                    var numberCell = row.insertCell(0);
                    var addressCell = row.insertCell(1);
                    var statusCell = row.insertCell(2);
                    numberCell.textContent = serialNumber++; // Increment serial number for each row
                    numberCell.style.fontSize = "9px"; // Font size for serial number
                    addressCell.textContent = address.trim();
                    addressCell.style.fontSize = "9px"; // Font size for address
                    statusCell.textContent = status.status;
                    statusCell.style.fontSize = "9px"; // Font size for status
                });
            });
        }

        // Call the function to populate the table
        populateTable(statusData);
    </script>
